import Link from 'next/link';

export default function Index() {
    return (
      <div>
        <Link href="/about"><a title="About page">Goto About</a></Link>
        <p>Hello Next.js!</p>
        <Link href="/[slug]"><a>To post</a></Link>
      </div>
    );
}
